import React from 'react';
import Header from './NavBar';
import {Table} from 'react-bootstrap'

const StudentList = () => {
    return (
        <div>
            <Header/>
            <h1 align="center">Course List</h1>
            <div className="col-sm-6 offset-sm-3">
            <Table>
                <tr>
                    <td>Id</td>
                    <td>Name</td>
                    <td>Price</td>
                    <td>Description</td>
                    <td>Image</td>
                    <td>Operations</td>
                </tr>

             
                    <tr>
                        <td></td>
                        <td></td>
                        <td></td>
                        <td></td>
                    </tr>

              

            </Table>
            </div>

           

        </div>


    );
};

export default StudentList;
